import React, { Component } from 'react'
import './App.css'

export default class App extends Component {



    render() {
        return (
            <ul className='App'>
                <li><img src='../public/img/img (6).png' /></li>
                <li><img src='../public/img/img (1).png' /></li>
                <li><img src='../public/img/img (6).png' /></li>
            </ul>
        )
    }
}
